INSERT INTO kaob.location (id, user_id, title, timestamp, latitude, longtitude, description) VALUES (33, 1, 'Seenekohad', '2023-12-15 07:06:08.990699', 59.265969, 25.936504, 'Beneath the twinkling night sky, a cozy campfire crackled, casting a warm glow on the faces of friends gathered around. The scent of roasting marshmallows wafted through the air, mingling with laughter and the distant murmur of a babbling brook. The flickering flames painted dancing shadows on the towering trees that stood sentinel in the moonlit forest. Stars sparkled like diamonds in the velvet sky, while the gentle rustle of leaves overhead provided a soothing melody to the serene scene.');
INSERT INTO kaob.location (id, user_id, title, timestamp, latitude, longtitude, description) VALUES (34, 1, 'Aare on maetud', '2023-12-15 07:06:25.603116', 59.279301, 25.966374, 'Under the ethereal glow of a full moon, a solitary figure walked along the deserted beach, the sand cool beneath their bare feet. The rhythmic lullaby of the waves accompanied their contemplative thoughts, as stars overhead winked in silent conversation. A distant lighthouse cast its beacon across the dark expanse of the sea, creating a path of silver ripples on the water''s surface.');
